import { WorkQueueStatusEventType } from './work-queue-status-event-type';
import { WorkQueueStatus } from './work-queue-status';
import { QueuePayload } from './queue-payload';
/**
 * The status event that will be emitted for every event in the unit of work queue process.
 */
export interface WorkQueueStatusEvent<TInput, TOutput> extends QueuePayload<TInput, TOutput> {
    event: WorkQueueStatusEventType;
    tokenId: string;
    status: WorkQueueStatus;
}
